LxPup 

by peebee

LxPup is a version of Puppy Linux with LXDE as its desktop environment.

Openbox, LxPanelX and PCManFM are the significant user components of LxPup (pup-volume-monitor is the significant system component).


LxPup is offered in various &quot;flavours&quot; corresponding to the Puppy Linux that forms their base.

Torrent archive contains many Lxpups and is current as at -02-Nov-2014 so select which of the many you want.

